import math

def calculate_max_tilt_angle(a: int, b: int, x: int) -> float:
    """"""
    if a * a * b <= x * 2:
        angle_radians = math.atan(2 * (a * a * b - x) / (a * a * a))
    else:
        angle_radians = math.atan(a * b * b / (2 * x))
    return math.degrees(angle_radians)
